import React from 'react';

export default class GenericPrivacyNotice extends React.Component {
  render() {
    return (
      <>
        <div className="text">
          <div className="text-highlight">
            <p>Your information will be processed  in accordance with UK Data Protection legislation, for further information please read our <a rel="noreferrer" target="_blank" href="http://www.leeds.gov.uk/Pages/PrivacyNotice.aspx">privacy notice</a>.</p>
          </div>
        </div>
      </>
    );
  }
}
